import React from 'react';

function About  (){
  <div>
    <h2>About PrognosisIQ</h2>
    <div className="card">
      <p>PrognosisIQ is an innovative platform designed to forecast disease progression using machine learning. Our goal is to empower doctors and researchers with accurate predictions to improve patient outcomes.</p>
    </div>
    <div className="card">
      <p>Developed by a team of AI and healthcare enthusiasts, PrognosisIQ combines data-driven insights with easy-to-use interfaces for professionals.</p>
    </div>
  </div>
}

export default About;
